def filter_arrays(hashed_array, functions, filename):
    with open(filename, 'r') as file:
        file_content = file.read()

    filtered1 = []
    filtered2 = []
    

    for value1, value2 in zip(hashed_array, functions):
        if value1 in file_content:
            filtered1.append(value1)
            filtered2.append(value2)

    return filtered1, filtered2

filename = "solve.txt"

filtered1, filtered2 = filter_arrays(hashed_array, functions, filename)


